import React, { Component } from 'react';

export default class Nav extends Component {
  constructor(props) {
    super(props);
    this.state = {
      active: ''
    };
    this.handleChange = this.handleChange.bind(this);
  }
  handleChange () {
  }
  componentDidMount() {
  }
  render() {
    return (
      <div>
        <div className="row">
          <div className="col-md-2">
            <a href="/"><img src="./logo.png" alt="MYNA logo" /></a>
          </div>
          <div className="col-md-8 capitalLetters">
            <ul className="navMenu">
              <li><a href="/lookbook">Lookbook</a></li>
              <li>
                <div className="dropdown">
                  <a class="dropdown-toggle" href="#" role="button" id="dropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Shop Collections</a>
                  <div className="dropdown-menu" aria-labelledby="dropdownMenuButton">
                    <a className="dropdown-item" href="#">Love & Light</a>
                    <a className="dropdown-item" href="#">Consciously Beautiful</a>
                    <a className="dropdown-item" href="#">View all items</a>
                    <a className="dropdown-item" href="#">Dresses</a>
                    <a className="dropdown-item" href="#">Tops</a>
                    <a className="dropdown-item" href="#">Bottoms</a>
                    <a className="dropdown-item" href="#">Basics</a>
                  </div>
                </div>
              </li>
              <li><a href="#">Sustainability</a></li>
              <li><a href="/our-story">Our Story</a></li>
            </ul>
          </div>
          <div className="col-md-2">
            <div className="row capitalLetters">
              <div className="col-md-7 ce padtop50px">
                <a className="menu" href="#">My Account</a>
              </div>
              <div className="col-md-5 ce padtop50px">
                <a className="menu" href="#">Cart (2)</a>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
